package com.sajansthapit.authserver.authclient.models;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Id;import jakarta.persistence.Table;import org.hibernate.annotations.CreationTimestamp;import org.hibernate.annotations.UpdateTimestamp;import java.time.Instant;@Entity@Table(name = "authorization_grant_type")public class AuthorizationGrantType {    @Id    private String id;    @Column(name = "grant_type")    private String grantType;    @CreationTimestamp    @Column(name = "created_at")    private Instant createdAt;    @UpdateTimestamp    @Column(name = "updated_at")    private Instant updatedAt;    public AuthorizationGrantType() {    }    public AuthorizationGrantType(String id, String grantType, Instant createdAt, Instant updatedAt) {        this.id = id;        this.grantType = grantType;        this.createdAt = createdAt;        this.updatedAt = updatedAt;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getGrantType() {        return grantType;    }    public void setGrantType(String grantType) {        this.grantType = grantType;    }    public Instant getCreatedAt() {        return createdAt;    }    public void setCreatedAt(Instant createdAt) {        this.createdAt = createdAt;    }    public Instant getUpdatedAt() {        return updatedAt;    }    public void setUpdatedAt(Instant updatedAt) {        this.updatedAt = updatedAt;    }}